import React from 'react';
import dino from './newDino.png';
import tree from './tree.png';
import animate from './animate.js';
import { DesignSystemDefaults } from '@microsoft/fast-components-styles-msft';
import { Button, ButtonAppearance, Image, Heading, Paragraph} from "@microsoft/fast-components-react-msft";

import { DesignSystemProvider } from "@microsoft/fast-jss-manager-react";
import { mergeDesignSystem } from "@microsoft/fast-jss-manager";
import { Page, Grid, Column} from "@microsoft/fast-layouts-react";

import './App.css';






class App extends React.Component {

  constructor(props){
    super(props);
    this.myDesign = {};
  }

  componentWillMount(){
    const newDesign= {
      backgroundColor: "#0F0"
    };

    this.myDesign = mergeDesignSystem(DesignSystemDefaults, newDesign);

  }

  render() {
    // console.log(DesignSystemDefaults);
    // console.log(newDesign);
    // console.log(myDesign);
    return (
      <DesignSystemProvider designSystem={this.myDesign}>
        <div className="App">
          <Page >

            <Grid>

              <Column>
                <Heading 
                  id="name"
                  tag={"h1"}
                  size={1}
                >
                  Samantha Orcutt
                </Heading>
              </Column>

            </Grid>

            <Grid>

              <Column-1 id="profile1">
                <Image
                  id="profilePicture"
                  src="https://via.placeholder.com/200/09f/fff.png"
                  alt="Samantha Orcutt"
                />
              </Column-1>

              <Column-2 id="profile2">

                <Heading
                  id="about"
                  tag={"h1"}
                  size={3}
                >
                  About Me
                </Heading>
                <Paragraph
                  size={1}
                >
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
                </Paragraph>
              </Column-2>

            </Grid>

            <Grid>

              <Column id="animateButtonColumn">
                <Button appearance={ButtonAppearance.primary} onClick={animate} >
                  Click me!
                </Button>
              </Column>

            </Grid>

            <Grid id="animationGrid">

              <Column-1 id="dinoColumn">
                <Image
                  id="dino"
                  src={dino}
                  alt="dino"
                />
              </Column-1>

              <Column-2 id="treeColumn1">
                <Image
                  id="tree1"
                  src={tree}
                  alt="tropical tree"
                />
              </Column-2>

              <Column-3 id="treeColumn2">
                <Image
                  id="tree2"
                  src={tree}
                  alt="tropical tree"
                />
              </Column-3>

              <Column-4 id="treeColumn3">
                <Image
                  id="tree3"
                  src={tree}
                  alt="tropical tree"
                />
              </Column-4>

            </Grid>

          </Page>
        </div>
      </DesignSystemProvider>

    );
  }

}


export default App;
